import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: 'test@test.com',
      senha: '',
    };
  }
  render() {
    return (
      <div className="App-header">
        email:
        <input type="email" name="email" value={this.state.email} />
        <br />
        Senha:
        <input type="password" name="senha" value={this.state.senha} />
      </div>
    );
  }
}

export default App;
